import React, {useState} from 'react'
import { Link } from 'react-router-dom';
import '../components/css/main.css'

import userIcon from '../components/assets/person.png'
import emailIcon from '../components/assets/email.png'
import passwordIcon from '../components/assets/password.png'

const Signup = () => {

  const [fullName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [password, setPassword] = useState('');
  const [password2, setPassword2] = useState('');
  const [email, setEmail] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission (e.g., send data to the server)
    console.log('FullName:', fullName);
    console.log('Email:', email);
    console.log('Password:', password);
    console.log('Password2:', password2);
  };

  return(
    <div className='container'>
      <div className='header'>
        <div className='text'>Sign Up</div>
        <div className='underline'></div>
      </div>
      <div className='inputs'>
        <div className='input'>
          <img src={userIcon} alt=''/>
          <input
            type="text"
            placeholder="Full Name"
            value={fullName}
            onChange={(e) => setFullName(e.target.value)}
          />
        </div>
        <div className='input'>
          <img src={emailIcon} alt=''/>
          <input
            type="email"
            placeholder="Email Address"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
        </div>
        <div className='input'>
          <img src={passwordIcon} alt=''/>
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
        <div className='input'>
          <img src={passwordIcon} alt=''/>
          <input
            type="password"
            placeholder="Confirm Password"
            value={password2}
            onChange={(e) => setPassword2(e.target.value)}
          />
        </div>
      </div>
      <div className='subheader'>Returning User? <Link to='/login'>Click Here!</Link></div>
      <div className='submit-container'>
      <button onClick={handleSubmit} className='submit'>Sign Up</button>
      </div>
    </div>
  )
}

export default Signup
